import React, { Component } from "react";
import withStyles from "@material-ui/core/styles/withStyles";

const styles = {
  card: {
    display: "flex",
  },
};

class Ability extends Component {
  render() {
    return <div></div>;
  }
}

export default withStyles(styles)(Ability);
